import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="container">
        <div className="row">
          <div className="col-2">
            <LeftNavigation />
          </div>
          <div className="col-8">
            <MiddleContent />
          </div>
          <div className="col-2">
            <RightPanel />
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
